		function bukvo(a) {
			var nait;
			nait = [];
			var cea = a;
			var mult = 52;
			while (cea > 0) {
				nait.push((((cea - 1) % mult) + 1) * 52 / mult);
				cea -= (((cea - 1) % mult) + 1);
				mult *= 52;
			}
		
			var sas;
			sas = "";
			for (i2 = 0; i2 < nait.length; ++i2) {
				sas += bukv(nait[nait.length - i2 - 1]);
			}
		
			return sas;
		}
		
